  async init() {
    await storeValue('ster_out_error', '');
    await qOpenRuns.run();
  },

	sql: {
    str(v) {
      if (v === undefined || v === null) return "NULL";
      return "'" + String(v).replace(/'/g, "''") + "'";
    },
    ts(d) {
      if (!d) return "NULL";
      // format without the ISO 'T'
      const s = moment(d).format("YYYY-MM-DD HH:mm:ss");
      return "'" + s + "'";
    },
    num(v) {
      const n = Number(v);
      return Number.isFinite(n) ? String(n) : "NULL";
    },
  },

  selectedRun() {
    const r = tblOpenRuns.selectedRow;
    return r && Object.keys(r).length ? r : null;
  },

  ensureRunSelected() {
    const r = this.selectedRun();
    if (!r) {
			showAlert("Select a run in the table first.", 'error');
      return null;
    }
    return r;
  },

  async onRunSelected() {
    txtErrOut.setText("");
    const r = this.selectedRun();
    if (r) {
      storeValue("selected_ster_run", r);
      if (!inpOperatorOut.text) inpOperatorOut.setValue(appsmith.user.email);
    }
  },

  async refresh() {
    txtErrOut.setText("");
		inpGoodCount.setValue("");
		inpDestroyedCount.setValue("");
		dpEndTime.setValue(null)
    return qOpenRuns.run();
  },

  async completeRun() {
		txtErrOut.setText("");
		const errs = this.validate();
		if (errs.length) {
			 await storeValue('ster_out_error', errs.join(" "));
			return;
		}
		const completedRun = await qCompleteRunMP.run();
		showAlert('Created ' + completedRun[0].lots_created + " lots from " + tblOpenRuns.selectedRow.steri_run_id + " and generated print job " + completedRun[0].print_queue_id, 'success');
		await storeValue('ster_out_error','Created ' + completedRun[0].lots_created + " lots from " + tblOpenRuns.selectedRow.steri_run_id + " and generated print job " + completedRun[0].print_queue_id);
		await this.refresh();
	},

	validate() {
		const errs = [];
		const run = this.selectedRun();
		if (!run) {
			showAlert('Select an open run.', 'error');
			errs.push("Select an open run.");
			return errs;
		}

		if(dpEndTime.selectedDate) {
			// Get the values directly from the widgets
			const startDate = tblOpenRuns.selectedRow.start_time; // e.g., "2024-01-15T00:00:00Z"
			const endDate = dpEndTime.selectedDate;   // e.g., "2024-01-20T00:00:00Z"

			// Direct comparison works correctly for ISO 8601 strings and Date objects
			if (startDate > endDate) {
				showAlert('End time cannot be before start time.', 'error');
				errs.push("End time cannot be before start time.");
			}
		}

		const planned = Number(run.planned_count);
		const good = (inpGoodCount.text === "" || inpGoodCount.text === null || inpGoodCount.text === undefined)
			? 0 : Number(inpGoodCount.text);
		const bad = (inpDestroyedCount.text === "" || inpDestroyedCount.text === null || inpDestroyedCount.text === undefined)
			? 0 : Number(inpDestroyedCount.text);

		if (!Number.isFinite(good) || good < 0) errs.push("Good count must be >= 0.");
		if (!Number.isFinite(bad)  || bad  < 0) errs.push("Destroyed count must be >= 0.");

		if (Number.isFinite(good) && Number.isFinite(bad) && (good + bad) <= 0) {
			showAlert('Good + Destroyed must be > 0.', 'error');
			errs.push("Good + Destroyed must be > 0.");
		}

		if (Number.isFinite(planned)) {
			if (!Number.isFinite(good) || !Number.isFinite(bad)) {
				// already covered
			} else if ((good + bad) !== planned) {
				showAlert(`Good (${good}) + Destroyed (${bad}) must equal Planned Count (${planned}).`, 'error');
				errs.push(`Good (${good}) + Destroyed (${bad}) must equal Planned Count (${planned}).`);
			}
		}

		// Operator required
		if (!inpOperatorOut.text || String(inpOperatorOut.text).trim() === "") {
			showAlert('Operator is required.', 'error');
			errs.push("Operator is required.");
		}

		return errs;
	},


};

