export default {
  sql: {
    str(v) {
      if (v === undefined || v === null || v === "") return "NULL";
      return "'" + String(v).replace(/'/g, "''") + "'";
    },
    num(v) {
      const n = Number(v);
      return Number.isFinite(n) ? String(n) : "NULL";
    },
    arrStr(arr) {
      // Safe Postgres text[] expression for use with = ANY(...)
      if (!arr || arr.length === 0) return "ARRAY[]::text[]";
      const vals = arr.map(x => "'" + String(x).replace(/'/g, "''") + "'");
      return "ARRAY[" + vals.join(", ") + "]::text[]";
    },
    arrBigint(arr) {
      // Safe Postgres bigint[] expression for function args
      if (!arr || arr.length === 0) return "ARRAY[]::bigint[]";
      const vals = arr.map(x => {
        const n = Number(x);
        return Number.isFinite(n) ? String(n) : "NULL";
      }).filter(x => x !== "NULL");
      if (vals.length === 0) return "ARRAY[]::bigint[]";
      return "ARRAY[" + vals.join(", ") + "]::bigint[]";
    },
  },

  selectedLotIds() {
    return (tblLots.selectedRows || []).map(r => r.nocopk).filter(Boolean);
  },

  formatSelectedLots() {
    const rows = (tblLots.selectedRows || []);
    if (!rows.length) return "(No lots selected)";
    return rows.map(r => {
      const lotId = r.lot_id ?? r.nocopk;
      const inoc = r.inoculated_at ? moment(r.inoculated_at).format("YYYY-MM-DD") : "";
      const item = r.item_name_mat || "";
      const strain = r.strain_species_strain_mat || "";
      return `${lotId} | inoc:${inoc} | ${item} | ${strain}`.trim();
    }).join("\n");
  },

  retireReason() {
    // CheckboxGroup1.selectedValues is usually an array
    const vals = chkgrpReasons.selectedValues || [];
    if (!vals.length) return "Retired";
    // prefer Contaminated over Compost over Expired if multiple
    const order = ["Contaminated", "Compost", "Expired"];
    for (const v of order) if (vals.includes(v)) return v;
    return vals[0];
  },

  lotTypeCategories() {
    const t = inpLotType.selectedOptionValue || "All";
    switch (t) {
      case "Grain": return ["grain"];
      case "Substrate": return ["substrate", "casing"];
      case "Liquid Culture": return ["lc_flask", "lc_syringe"];
      case "Fruiting Block": return ["fruiting_block"];
      case "Freeze Dried Mushrooms": return ["freezedriedmushrooms"];
      case "Tray": return ["freezer_tray", "fresh_tray", "empty_tray"];
      case "Agar": return ["agar_flask", "plate"];
      case "Untracked": return ["untracked_source"];
      case "All":
      default: return [];
    }
  },

  statusSet() {
    const s = inpLotStatus.selectedOptionValue || "All";
    switch (s) {
      case "New": return ["Planned", "Sterilized", "Pasteurized", "Sealed"];
      case "Colonizing": return ["Inoculated", "Spawned", "Colonizing"];
      case "Colonized/Fridge": return ["FullyColonized", "Fridge", "ColdShock"];
      case "Fruiting": return ["Fruiting"];
      case "Frozen": return ["Frozen"];
      case "Retired": return ["Consumed", "Retired"];
      case "All Active":
        return ["Planned","Sterilized","Pasteurized","Sealed","Inoculated","Spawned","Colonizing","FullyColonized","Fridge","ColdShock","Fruiting","Frozen"];
      case "All":
      default: return [];
    }
  },

  processTypeSet() {
    const out = [];
    if (chkSterilized.isChecked) out.push("sterilize","sterilized");
    if (chkPasteurized.isChecked) out.push("pasteurize","pasteurized");
    return out;
  },

  regulatedMode() {
    const r = chkRegulated.isChecked;
    const u = chkUnRegulated.isChecked;
    if ((r && u) || (!r && !u)) return "all";
    if (r) return "regulated";
    return "unregulated";
  },

  async refresh() {
    txtErrLots.setText("");
    try {
      await qLots.run();
    } catch (e) {
      txtErrLots.setText(e?.message || String(e));
    }
  },

  async init() {
    txtErrLots.setText("");
    try { await qSpecies.run(); } catch (e) {}
    await this.refresh();
  },

  async openShakeModal() {
    if (!this.selectedLotIds().length) return showAlert("Select one or more lots first.", "warning");
    txtShakeContent.setText(this.formatSelectedLots());
    await showModal("modalShakeLots");
  },

  async confirmShake() {
    if (!this.selectedLotIds().length) return showAlert("Select one or more lots first.", "warning");
    await qShakeLots.run();
    await closeModal("modalShakeLots");
    await this.refresh();
    showAlert("Shake event logged for selected lots.", "success");
  },

  async openRetireModal() {
    if (!this.selectedLotIds().length) return showAlert("Select one or more lots first.", "warning");
    txtRetireContent.setText(this.formatSelectedLots());
    await showModal("modalRetireLots");
  },

  async confirmRetire() {
    if (!this.selectedLotIds().length) return showAlert("Select one or more lots first.", "warning");
    await qRetireLots.run();
    await closeModal("modalRetireLots");
    await this.refresh();
    showAlert("Selected lots retired.", "success");
  },

  selectedLotsSummary() {
    const rows = (tblLots.selectedRows || []).filter(r => r && r.nocopk != null);
    if (!rows.length) return "No lots selected.";
    return rows.map(r => {
      const lot = r.lot_id || r.lotId || r.lot_id_mat || r.nocopk;
      const inoc = r.inoculated_at || r.inoculatedAt || r.created_at || r.createdAt || "";
      const item = r.item_name_mat || r.item_name || r.itemName || "";
      const strain = r.strain_species_strain_mat || r.strain_species_strain || r.species_strain || "";
      return `${lot} | inoculated: ${inoc || "—"} | ${item} | ${strain}`;
    }).join("\n");
  },

  async shakeSelectedLots() {
    await qShakeLots.run();
    closeModal(modalShakeLots.name);
    await qLots.run();
  },

  async retireSelectedLots() {
    await qRetireLots.run();
    closeModal(modalRetireLots.name);
    await qLots.run();
  },

};

