		if (!this.selectedLotIds().length) return showAlert("Select one or more lots first.", "warning");

		let lotsretired;
    try {
      lotsretired = await qRetireLots.run();
      // refresh downstream view
    } catch (e) {
			showAlert("Error retiring lots: " + (e && e.message) ? e.message : String(e), 'error');
      await storeValue('lots_error', (e && e.message) ? e.message : String(e));
			return;
    }	

		showAlert("Retired " + lotsretired[0].retired_count + " lot(s).", 'success');

		txtRetireContent.setText("");
		inpRetireNotes.setValue("");		
    closeModal(modalRetireLots.name);
    await qLots.run();
  },

