SELECT *
FROM public.vc_lots
WHERE 1=1
  AND (
    {{ inpLotType.selectedOptionValue === 'All' ? 'true' : 'false' }} = 'true'
    OR item_category_mat = ANY({{ LotsPage.sql.arrStr(LotsPage.lotTypeCategories()) }})
  )
  AND (
    {{ inpLotStatus.selectedOptionValue === 'All' ? 'true' : 'false' }} = 'true'
    OR status = ANY({{ LotsPage.sql.arrStr(LotsPage.statusSet()) }})
  )
  AND (
    {{ (chkSterilized.isChecked || chkPasteurized.isChecked) ? 'true' : 'false' }} = 'false'
    OR (
      LOWER(COALESCE(process_type_mat::text,'')) = ANY({{ LotsPage.sql.arrStr(LotsPage.processTypeSet()) }})
      OR LOWER(COALESCE(process_type_mat_from_substrate_inputs::text,'')) = ANY({{ LotsPage.sql.arrStr(LotsPage.processTypeSet()) }})
    )
  )
  AND (
    {{ inpStrains.selectedOptionValue && inpStrains.selectedOptionValue !== 'All' ? 'true' : 'false' }} = 'false'
    OR strain_species_strain_mat = {{ LotsPage.sql.str(inpStrains.selectedOptionValue) }}
  )
  AND (
    {{ LotsPage.sql.str(LotsPage.regulatedMode()) }} = 'all'
    OR ({{ LotsPage.sql.str(LotsPage.regulatedMode()) }} = 'regulated'
        AND TRUE = ANY(COALESCE(regulated_from_strain_id, ARRAY[FALSE]::boolean[]))
    )
    OR ({{ LotsPage.sql.str(LotsPage.regulatedMode()) }} = 'unregulated'
        AND NOT (TRUE = ANY(COALESCE(regulated_from_strain_id, ARRAY[FALSE]::boolean[])))
    )
  )
ORDER BY COALESCE(created_at, now()) DESC
LIMIT 2000;

