  if (!LotsPage.selectedLotIds().length) return showAlert("Select one or more lots first.", "warning");
  let lotsshaken;
  try {
    lotsshaken = await qShakeLots.run();
  } catch (e) {
    showAlert("Error flagging lots as shaken: " + (e && e.message) ? e.message : String(e), 'error');
    await storeValue('lots_error', e && e.message ? e.message : String(e));
    return;
  }
  showAlert("Shook " + lotsshaken[0].shaken_count + " lot(s).", 'success');
  txtShakeContent.setText("");
  inpShakeNotes.setValue("");
  closeModal(modalShakeLots.name);
  await qLots.run();
}

